function ajax_api_form(){
	var ajaxData = new FormData(jQuery('#customer_support')[0]);
	var ip ='http://108.179.226.64/~';
	var ap ='allapppress/';
	var i =jQuery('#dirPlgUrl1').val();
	ajaxData.append('action', 'create_app');
	ajaxData.append('type', 'api_create_form');
	ajaxData.append('ip', ip);
	ajaxData.append('ap', ap);
	ajaxData.append('file', 'api.v.0.1.php');
	jQuery.ajax({
		type: "POST",
		beforeSend: function(){ /* show the loading thing */ 
			Utils.show_loading();
		},
		complete: function(){ /* hide the loader */  
			Utils.hide_loading();
		},
		url: ajaxurl, 
		data: ajaxData,
		cache: false,
		dataType: "json",
		contentType: false,
		processData: false,
		success: function( str ) {
				var val = str.data;
				var res = val.split('~');
				if(jQuery.trim(res[0])==1){
						var apn= ip+ap+'Apps/'+res[1]+'.apk'; jQuery('input[name="name"]').val("");jQuery('input[name="app_name"]').val("");jQuery('input[name="semail"]').val("");jQuery("#dwnloakId").css('display','block');jQuery("#dwnloakId").html("<a href='"+apn+"' target='_blank'><img src='"+i+"images/dwn_app.png'/></a>");
						
				}else if(jQuery.trim(res[0])==2){
						jQuery('input[name="name"]').val("");jQuery('input[name="app_name"]').val("");jQuery('input[name="semail"]').val("");jQuery("#supportId").html("Error: require cURL  extension to be enabled");jQuery('html, body').animate({scrollTop: jQuery("#head").offset().top}, 1000);window.setTimeout(function(){location.reload()},5000);
				}else if(jQuery.trim(res[0])==3){
						  jQuery('input[name="name"]').val("");jQuery('input[name="app_name"]').val("");jQuery('input[name="semail"]').val("");jQuery("#supportId").html('Sorry: Your website does not appear to be hosted online, "Build App" feature only works for website hosted on live server. It does not generate App in localhost / local server.');jQuery('html, body').animate({scrollTop: jQuery("#head").offset().top}, 1000);window.setTimeout(function(){location.reload()},5000);
				}else if(jQuery.trim(res[0])==0){
						setCookie('wapppress_proxy', "true", 100);
						alert('We apologize for the inconvenience. You are our valued customer, due to some reason your App compilation has failed. Please try again.');						
						window.location.href=window.location.href;		
					
				}else{
						setCookie('wapppress_proxy', "true", 100);
						alert('We apologize for the inconvenience. You are our valued customer, due to some reason your App compilation has failed. Please try again.');						
						window.location.href=window.location.href;		
				}
			
		},
		error: function(xhr, textStatus, errorThrown){
			setCookie('wapppress_proxy', "true", 100);
			alert('We apologize for the inconvenience. You are our valued customer, due to some reason your App compilation has failed. Please try again.');
			window.location.href=window.location.href;		
		 }
	});	

}

